import Axios from 'axios';

export const createDoctor = async (doctor) => {
  let res = await Axios.get(
    `http://localhost:3000/geocodes/details/${doctor.place_id}`
  );
  const detailedDoctor = res.data.result;
  const {
    formatted_address,
    formatted_phone_number,
    name,
    opening_hours,
    place_id,
    rating,
    url,
    website,
    user_ratings_total,
    geometry: {
      location: { lat, lng },
    },
  } = detailedDoctor;

  const doctorHash = {
    place_id,
    name,
    formatted_address,
    opening_hours,
    rating,
    user_ratings_total,
    formatted_phone_number,
    lat,
    lng,
    url,
    website
  };

  let postedDoc = Axios.post()



  return doctorHash;
};
